<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Trade Rabbit — Coming Soon</title>
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link href="https://fonts.googleapis.com/css2?family=Inter:wght@300;400;500;600;700&family=Space+Grotesk:wght@400;500;600;700&display=swap" rel="stylesheet">
    <style>
        *, *::before, *::after {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        :root {
            --green: #00C853;
            --green-dark: #00A844;
            --green-glow: rgba(0, 200, 83, 0.35);
            --bg-dark: #0a0a0a;
        }

        html, body {
            height: 100%;
            overflow: hidden;
        }

        body {
            font-family: 'Inter', -apple-system, BlinkMacSystemFont, sans-serif;
            background: var(--bg-dark);
            color: #ffffff;
            display: flex;
            align-items: center;
            justify-content: center;
        }

        /* ── Background ── */
        .bg {
            position: fixed;
            inset: 0;
            z-index: 0;
        }

        .bg img {
            width: 100%;
            height: 100%;
            object-fit: cover;
            filter: grayscale(0.6) brightness(0.35) contrast(1.1);
        }

        /* Gradient overlay */
        .bg::after {
            content: '';
            position: absolute;
            inset: 0;
            background:
                linear-gradient(180deg,
                    rgba(0,0,0,0.7) 0%,
                    rgba(0,0,0,0.4) 40%,
                    rgba(0,0,0,0.6) 70%,
                    rgba(0,0,0,0.9) 100%
                ),
                linear-gradient(135deg,
                    rgba(0, 200, 83, 0.06) 0%,
                    transparent 60%
                );
        }

        /* Scanline effect for retro feel */
        .scanlines {
            position: fixed;
            inset: 0;
            z-index: 1;
            pointer-events: none;
            background: repeating-linear-gradient(
                0deg,
                transparent,
                transparent 2px,
                rgba(0, 0, 0, 0.03) 2px,
                rgba(0, 0, 0, 0.03) 4px
            );
        }

        /* Noise texture */
        .noise {
            position: fixed;
            inset: 0;
            z-index: 1;
            pointer-events: none;
            opacity: 0.04;
            background-image: url("data:image/svg+xml,%3Csvg viewBox='0 0 256 256' xmlns='http://www.w3.org/2000/svg'%3E%3Cfilter id='n'%3E%3CfeTurbulence type='fractalNoise' baseFrequency='0.85' numOctaves='4' stitchTiles='stitch'/%3E%3C/filter%3E%3Crect width='100%25' height='100%25' filter='url(%23n)' opacity='1'/%3E%3C/svg%3E");
            background-size: 256px 256px;
        }

        /* ── Content ── */
        .content {
            position: relative;
            z-index: 2;
            display: flex;
            flex-direction: column;
            align-items: center;
            text-align: center;
            padding: 2rem;
            max-width: 640px;
            animation: fadeUp 1.2s ease-out;
        }

        @keyframes fadeUp {
            from {
                opacity: 0;
                transform: translateY(30px);
            }
            to {
                opacity: 1;
                transform: translateY(0);
            }
        }

        /* Logo */
        .logo-wrap {
            width: 160px;
            height: 160px;
            margin-bottom: 2rem;
            position: relative;
        }

        .logo-wrap::before {
            content: '';
            position: absolute;
            inset: -20px;
            border-radius: 50%;
            background: radial-gradient(circle, var(--green-glow), transparent 70%);
            animation: pulse 3s ease-in-out infinite;
        }

        @keyframes pulse {
            0%, 100% { opacity: 0.5; transform: scale(1); }
            50% { opacity: 0.8; transform: scale(1.05); }
        }

        .logo-wrap img {
            width: 100%;
            height: 100%;
            object-fit: contain;
            position: relative;
            z-index: 1;
            filter: drop-shadow(0 0 12px rgba(0, 200, 83, 0.6)) drop-shadow(0 0 30px rgba(0, 200, 83, 0.3));
        }

        /* Brand name */
        .brand {
            font-family: 'Space Grotesk', sans-serif;
            font-size: 3rem;
            font-weight: 700;
            letter-spacing: 0.12em;
            text-transform: uppercase;
            margin-bottom: 0.5rem;
            background: linear-gradient(135deg, #ffffff 0%, #b0b0b0 100%);
            -webkit-background-clip: text;
            -webkit-text-fill-color: transparent;
            background-clip: text;
        }

        /* Coming soon badge */
        .coming-soon {
            font-family: 'Space Grotesk', sans-serif;
            font-size: 0.85rem;
            font-weight: 500;
            letter-spacing: 0.35em;
            text-transform: uppercase;
            color: var(--green);
            margin-bottom: 1.5rem;
            padding: 0.5rem 1.5rem;
            border: 1px solid rgba(0, 200, 83, 0.3);
            border-radius: 100px;
            background: rgba(0, 200, 83, 0.06);
        }

        /* Tagline */
        .tagline {
            font-size: 1.05rem;
            font-weight: 300;
            line-height: 1.7;
            color: rgba(255, 255, 255, 0.6);
            margin-bottom: 2.5rem;
            max-width: 460px;
        }

        /* ── Email Form ── */
        .form-wrap {
            width: 100%;
            max-width: 440px;
        }

        .input-group {
            display: flex;
            gap: 0;
            border-radius: 12px;
            overflow: hidden;
            border: 1px solid rgba(255, 255, 255, 0.1);
            background: rgba(255, 255, 255, 0.05);
            backdrop-filter: blur(20px);
            transition: border-color 0.3s, box-shadow 0.3s;
        }

        .input-group:focus-within {
            border-color: var(--green);
            box-shadow: 0 0 0 3px rgba(0, 200, 83, 0.15), 0 0 40px rgba(0, 200, 83, 0.08);
        }

        .input-group input {
            flex: 1;
            padding: 1rem 1.25rem;
            background: transparent;
            border: none;
            outline: none;
            color: #fff;
            font-family: 'Inter', sans-serif;
            font-size: 0.95rem;
            font-weight: 400;
        }

        .input-group input::placeholder {
            color: rgba(255, 255, 255, 0.35);
        }

        .input-group button {
            padding: 1rem 1.75rem;
            background: var(--green);
            color: #000;
            border: none;
            font-family: 'Inter', sans-serif;
            font-size: 0.85rem;
            font-weight: 600;
            letter-spacing: 0.05em;
            text-transform: uppercase;
            cursor: pointer;
            transition: background 0.3s;
            white-space: nowrap;
        }

        .input-group button:hover {
            background: var(--green-dark);
        }

        .form-note {
            font-size: 0.75rem;
            color: rgba(255, 255, 255, 0.3);
            margin-top: 0.75rem;
        }

        /* Success state */
        .success-msg {
            display: none;
            color: var(--green);
            font-size: 0.95rem;
            font-weight: 500;
            padding: 1rem;
            animation: fadeUp 0.5s ease-out;
        }

        .success-msg.show {
            display: block;
        }

        /* ── Ticker bar ── */
        .ticker {
            position: fixed;
            bottom: 0;
            left: 0;
            right: 0;
            z-index: 3;
            height: 36px;
            background: rgba(0, 0, 0, 0.85);
            border-top: 1px solid rgba(0, 200, 83, 0.15);
            overflow: hidden;
            display: flex;
            align-items: center;
        }

        .ticker-track {
            display: flex;
            white-space: nowrap;
            animation: scroll 40s linear infinite;
        }

        .ticker-track span {
            font-family: 'Space Grotesk', monospace;
            font-size: 0.75rem;
            letter-spacing: 0.05em;
            padding: 0 2rem;
            color: rgba(255, 255, 255, 0.5);
        }

        .ticker-track span .up { color: var(--green); }
        .ticker-track span .down { color: #ff4444; }
        .ticker-track span .sym { color: rgba(255, 255, 255, 0.7); font-weight: 600; }

        @keyframes scroll {
            from { transform: translateX(0); }
            to { transform: translateX(-50%); }
        }

        /* ── Top bar ── */
        .top-bar {
            position: fixed;
            top: 0;
            left: 0;
            right: 0;
            z-index: 3;
            height: 3px;
            background: linear-gradient(90deg, var(--green), rgba(0, 200, 83, 0.2), var(--green));
            background-size: 200% 100%;
            animation: shimmer 3s ease-in-out infinite;
        }

        @keyframes shimmer {
            0%, 100% { background-position: 0% 50%; }
            50% { background-position: 100% 50%; }
        }

        /* ── Responsive ── */
        @media (max-width: 600px) {
            .brand {
                font-size: 2rem;
                letter-spacing: 0.08em;
            }

            .logo-wrap {
                width: 100px;
                height: 100px;
                margin-bottom: 1.5rem;
            }

            .tagline {
                font-size: 0.95rem;
            }

            .input-group {
                flex-direction: column;
                border-radius: 12px;
            }

            .input-group button {
                border-radius: 0;
            }
        }
    </style>
</head>

    <div class="ticker">
        <div class="ticker-track" id="ticker">
        </div>
    </div>

    <script>
        // ── Live Ticker ──
        const AV_KEY = 'J3RVYIEMTEXOUREW';
        const CACHE_TTL = 5 * 60 * 1000; // 5 min cache to preserve API quota

        const STOCKS = ['AAPL', 'TSLA', 'NVDA', 'MSFT', 'AMZN', 'META', 'GOOGL'];
        const CRYPTO_IDS = { bitcoin: 'BTC', ethereum: 'ETH', solana: 'SOL' };
        const FOREX = [
            { from: 'EUR', to: 'USD' },
            { from: 'GBP', to: 'USD' },
            { from: 'USD', to: 'JPY' },
        ];

        function fmt(n) {
            return n >= 1000 ? n.toLocaleString('en-US', { minimumFractionDigits: 2, maximumFractionDigits: 2 })
                             : n.toFixed(n < 1 ? 4 : 2);
        }

        function pctStr(pct) {
            return (pct >= 0 ? '+' : '') + pct.toFixed(2) + '%';
        }

        function renderTicker(items) {
            if (!items.length) return;
            const track = document.getElementById('ticker');
            const html = items.map(t =>
                `<span><span class="sym">${t.sym}</span> ${t.prefix || '$'}${t.price} <span class="${t.up ? 'up' : 'down'}">${t.change}</span></span>`
            ).join('');
            track.innerHTML = html + html;
        }

        // ── Cache helpers (sessionStorage) ──
        function cacheGet(key) {
            try {
                const raw = sessionStorage.getItem('tr_' + key);
                if (!raw) return null;
                const { data, ts } = JSON.parse(raw);
                if (Date.now() - ts > CACHE_TTL) return null;
                return data;
            } catch { return null; }
        }
        function cacheSet(key, data) {
            try { sessionStorage.setItem('tr_' + key, JSON.stringify({ data, ts: Date.now() })); }
            catch {}
        }

        // ── Alpha Vantage: Stock quote ──
        async function fetchStock(sym) {
            const cached = cacheGet('stock_' + sym);
            if (cached) return cached;
            const url = `https://www.alphavantage.co/query?function=GLOBAL_QUOTE&symbol=${sym}&apikey=${AV_KEY}`;
            const res = await fetch(url);
            const json = await res.json();
            const q = json['Global Quote'];
            if (!q || !q['05. price']) return null;
            const price = parseFloat(q['05. price']);
            const pct = parseFloat(q['10. change percent']);
            const item = { sym, price: fmt(price), change: pctStr(pct), up: pct >= 0 };
            cacheSet('stock_' + sym, item);
            return item;
        }

        // ── Alpha Vantage: Forex ──
        async function fetchForex(from, to) {
            const key = `fx_${from}${to}`;
            const cached = cacheGet(key);
            if (cached) return cached;
            const url = `https://www.alphavantage.co/query?function=CURRENCY_EXCHANGE_RATE&from_currency=${from}&to_currency=${to}&apikey=${AV_KEY}`;
            const res = await fetch(url);
            const json = await res.json();
            const r = json['Realtime Currency Exchange Rate'];
            if (!r) return null;
            const rate = parseFloat(r['5. Exchange Rate']);
            // Forex doesn't return % change, show rate only
            const item = { sym: from + '/' + to, price: rate.toFixed(to === 'JPY' ? 2 : 4), change: '', up: true, prefix: '' };
            cacheSet(key, item);
            return item;
        }

        // ── CoinGecko: Crypto (bulk, free, no key) ──
        async function fetchCrypto() {
            const cached = cacheGet('crypto');
            if (cached) return cached;
            const ids = Object.keys(CRYPTO_IDS).join(',');
            const res = await fetch(`https://api.coingecko.com/api/v3/simple/price?ids=${ids}&vs_currencies=usd&include_24hr_change=true`);
            const data = await res.json();
            const items = [];
            for (const [id, sym] of Object.entries(CRYPTO_IDS)) {
                const d = data[id];
                if (!d) continue;
                const pct = d.usd_24h_change || 0;
                items.push({ sym, price: fmt(d.usd), change: pctStr(pct), up: pct >= 0 });
            }
            cacheSet('crypto', items);
            return items;
        }

        // ── Orchestrate with rate-limit awareness ──
        // AV free tier: 25 req/day. Stagger stock calls, cache aggressively.
        async function delay(ms) { return new Promise(r => setTimeout(r, ms)); }

        const allItems = [];

        async function fetchAll() {
            allItems.length = 0;

            // 1. Crypto first (CoinGecko, instant, no AV quota)
            try {
                const crypto = await fetchCrypto();
                allItems.push(...crypto);
                renderTicker(allItems);
            } catch {}

            // 2. Stocks (stagger to respect rate limits)
            for (const sym of STOCKS) {
                try {
                    const item = await fetchStock(sym);
                    if (item) { allItems.push(item); renderTicker(allItems); }
                } catch {}
                await delay(1500); // ~1.5s between calls
            }

            // 3. Forex
            for (const { from, to } of FOREX) {
                try {
                    const item = await fetchForex(from, to);
                    if (item) { allItems.push(item); renderTicker(allItems); }
                } catch {}
                await delay(1500);
            }
        }

        fetchAll();
        // Refresh every 5 min (matches cache TTL)
        setInterval(fetchAll, CACHE_TTL);

        // ── Form → Google Sheets ──
        // Replace this URL with your deployed Google Apps Script web app URL
        const SHEETS_URL = 'https://script.google.com/macros/s/AKfycbzrlzPkihmRs9jhjkw3qeRPX3bUzMvvvuFlCEMlcQNiZxIUWjHVov92bpsJwWOUBhDB/exec';

        document.getElementById('signup-form').addEventListener('submit', async function(e) {
            e.preventDefault();
            const emailInput = this.querySelector('input[type="email"]');
            const email = emailInput.value.trim();
            if (!email) return;

            const btn = this.querySelector('button');
            btn.textContent = 'SENDING...';
            btn.disabled = true;

            try {
                const params = new URLSearchParams({
                    email,
                    timestamp: new Date().toISOString(),
                });
                await fetch(SHEETS_URL + '?' + params.toString(), { mode: 'no-cors' });
                // no-cors means we can't read the response, but the request goes through
                this.style.display = 'none';
                document.querySelector('.form-note').style.display = 'none';
                document.getElementById('success-msg').classList.add('show');
            } catch {
                btn.textContent = 'TRY AGAIN';
                btn.disabled = false;
            }
        });
    </script>

</body>
